import React from 'react';
import ReactDOM from 'react-dom';
import Comment from './CommentDetail';

const App = () => {

    return (
        <div className="ui container comments">
           {{Comment}}
        </div>
    );
}

ReactDOM.render(<App/>,document.querySelector("#root"));
